import styled from 'styled-components';

export const HeaderProfileContainer = styled.div`
  background: white;
  min-height: 200px;
  position: fixed;
  width: 100%;
  z-index: 10;
  display: flex;
  align-items: center;
`;

export const GridContainer = styled.div`
  height: 100%;
  width: 100%;
  margin: auto;
`;

export const TitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-Bold';
  text-align: center;
  font-size: 24px;
  color: var(--primary-green);
`;

export const SubtitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-SemiBold';
  text-align: center;
  font-size: 14px;
  color: var(--base-gray-light);
`;

export const BronzeFlag = styled.img`
  width: 240px;
  height: auto;
  margin: auto;
`;

export const FlagContainer = styled.div`
  position: relative;
  height: 100%;
  width: 100%;
  margin: auto;
  display: flex;
`;

export const Capacete2 = styled.img`
  width: -webkit-fill-available;
  height: auto;
  position: absolute;
  bottom: -53px;
  margin: auto;
  left: 50%;
  transform: translateX(-50%);
`;

export const Capacete1 = styled.img`
  width: 240px;
  height: auto;
  position: absolute;
  top: -140px;
  margin: auto;
  left: 50%;
  transform: translateX(-50%);
`;

export const TextFlagContainer = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  text-align: center;
  color: white;
`;

export const Elo = styled.p`
  font-weight: bold;
  font-size: 16px;
  padding: 4px;
`;

export const Queue = styled.p`
  font-size: 16px;
  padding: 4px;
`;

export const Pdl = styled.p`
  font-weight: bold;
  font-size: 14px;
  font-weight: bold;
  text-transform: uppercase;
  padding: 4px;
`;
